span.span:
与内置类型一致的读写：
std::string s1, s2;
std::cin >> s1 >> s2;
std::cout << s1 << s2 << std::endl;

std::string line;
std::getline(std::cin, line); 
// 每次读入一整行直至EOF

while(std::getline(std::cin, line))
    if (!line.empty())
        std::cout << line <<std::endl;

while(std::getline(std::cin, line))
    if (!line.size() > 80)
        std::cout << line <<std::endl;

size_type类型可以通过auto来忽略：
auto len = line.size();
或者用decltype来阐明：
decltype(line.size()) len = line.size();

按照字典顺序（即编码值）比较：
string str = "Hello";
string str1 = "Hello World";
string str2 = "Hiya";

与内置类型一致：
string st1(10, 'c'), st2;
st1 = st2;

得到一个新的string对象：
string s1 = "Hello, ", s2 = "World";
string s3 = s1 + s2;
